import Nav from './Nav'


const About = () => {


    useEffect(() => {
        const logo = document.getElementById("test")
        console.log(logo)
        if (logo) logo.style.display = "none"
    })

    return (
        <div>
            <Nav nav="about"/>

            <div className="aboutPage">
                <div className="logoHeading">
                    MEIKA FRECKELTON
                </div>
                <div className="aboutTopSection">

                </div>

            </div>
        </div>
    )
}

export default About
